let ISHIDPI = undefined;

Array.prototype.binarySearch = function(target){
    let max = this.length -1;
    let min = 0;
    let mid;
    let elm;

    while (min <= max){
        mid = ((max + min) / 2) | 0;
        elm = this[mid][0];

        if(target < elm){
            max = mid - 1;
        } else if (target > elm){
            min = mid + 1;
        } else{
            return mid;
        }
    }

    return -1;
}

function findTorIp(ip) {
    let max = TOR.length -1;
    let min = 0;
    let mid;
    let elm;

    while (min <= max){
        mid = ((max + min) / 2) | 0;
        elm = TOR[mid];

        if(ip < elm){
            max = mid - 1;
        } else if (ip > elm){
            min = mid + 1;
        } else{
            return mid;
        }
    }

    return false;
}

function findProxy(ip) {
    let info = null;
    for (null, n = PROXY.length; n--;)
        if (ip === PROXY[n][0]) {
            info = PROXY[n][1];
            break
        } return info
}

function findIpinArray(ip, array) {
    let ip_front = ip.split('.')[0];
    let ip_back = ip.split('.')[1];
    let f_index = array.binarySearch(ip_front);
    let b_index;

    if(f_index !==  -1){
        b_index = array[f_index][1].binarySearch(ip_back);

        if(b_index !== -1){
            return [array[f_index][1][b_index][1], array[f_index][1][b_index][2]];
        } else {
            return false;
        }

    } else {
        return false;
    }
}

