function setState() {
    const urlpath = window.location.pathname;
    
    if (urlpath.indexOf('/list') != -1) {
        if (window.location.search.indexOf('&board_type=album') != -1) {
            return -3;
        } else{
            return 1;
        }
    } else if (urlpath.indexOf('/view') != -1) {
        return -2;
    } else if (urlpath.indexOf('/write') != -1) {
        return -4;
    } else {
        return -1;
    }
}

