function observeDcLoaded(){
    const target = STATE === 1 ? 'floating_box' : 'list_bottom_btnbox';
    const glist_obsrv = new MutationObserver((mutations, observer) => {
        for(mutation of mutations){ 
            if(mutation.addedNodes.length === 0 || mutation.removedNodes.length > 0){
                continue;
            }
            if(mutation.target.className == target){
                observer.disconnect();
                initdibe();
                return;
            }
        };
    });

    glist_obsrv.observe(document, {
        childList: true,
        subtree: true,
        attributes: false,
        characterData: false
    });
}

function checkDcPath() {
    STATE = setState();
    if(STATE === 1 || STATE === -2 || STATE === -3){
        observeDcLoaded();
        initconsole();
    } else if(STATE === -4){
        if(DIBESETTING.isdarkmode){
            document.addEventListener('DOMContentLoaded', () => {
                document.getElementById('tx_canvas_wysiwyg').contentWindow.document.body.style = 'color:#e0e0e0 !important; background-color:#333 !important;';
            });
        }
        initconsole();
    }
}

chrome.storage.local.get(null, (key) => {
    DIBESETTING = key;
    checkDcPath();
});